// Function for Hamburger Menu
$('#mobile_nav_hamgergerIcon').on('click', function () {
    $('#animated-icon').toggleClass('open');
    $('#navbarSupportedContent').toggleClass('open');
    $('#mobile_nav').toggleClass('open');
    $('body').toggleClass('sticky');
    myFunction();
});

$('.nav-link').on('click', function () {
    $('#animated-icon').removeClass('open');
    $('#navbarSupportedContent').removeClass('open');
    $('#mobile_nav').removeClass('open');
    $('body').removeClass('sticky');
    myFunction();
});

window.onscroll = function () {
    myFunction()
};

var navbar = document.getElementById("mobile_nav");

function myFunction() {
    if ($(document).scrollTop() >= 5) {
        navbar.classList.add("sticky")
    } else {
        navbar.classList.remove("sticky");
    }
}

let url = window.location.href.split('/');
let pagename = url[url.length - 1].split('.')[0];
let menus = $('#menus').children();
for (let i = 0; i < menus.length; i++)
    menus[i].classList.remove('active');
$('#' + pagename).addClass('active');

/*Go to top*/
const scrollToTopButton = document.getElementById('js-top');
const scrollFunc = () => {
    let y = window.scrollY;

    if (y > 0) {
        scrollToTopButton.className = "top-link show";
    } else {
        scrollToTopButton.className = "top-link hide";
    }
};
window.addEventListener("scroll", scrollFunc);
const scrollToTop = () => {
    // Let's set a variable for the number of pixels we are from the top of the document.
    const c = document.documentElement.scrollTop || document.body.scrollTop;
    if (c > 0) {
        window.requestAnimationFrame(scrollToTop);
        window.scrollTo(0, c - c / 10);
    }
};

scrollToTopButton.onclick = function(e) {
    e.preventDefault();
    scrollToTop();
};

